module.exports = JSON.parse('[{"id":1,"name":"Imo Pocha","slug":"imo-pocha","cover":"imo-pocha-1.png","meals":"Lunch, Dinner","cuisine":"Korean","type":"Restaurant","tags":"Kimbap, Bibimbap, Corn Cheese","price":"$$","notes":"Cramped space with circular tables and stool chairs. Food takes longer to come out due to number of employees. Smaller portions than expected.","rating":"B","address":"1621 E Olive Wy, Seattle, WA 98102","url":"https://maps.app.goo.gl/RTSBxmm1mxZEsLMR9"},{"id":2,"name":"Seoul Tofu & Jjim","slug":"seoul-tofu-and-jjim","cover":"seoul-tofu-and-jjim-1.png","meals":"Lunch, Dinner","cuisine":"Korean","type":"Restaurant","tags":"Bibimbap, Corn Cheese, Soondubu, Galbi, Noodles, Bulgogi, Pork Bone Stew","price":"$$","notes":"Large open space with lots of seating options. All entress include a set of unlimited Banchan. A free sweet treat will be offered at the end of the meal.","rating":"A","address":"406 Broadway E, Seattle, WA 98102","url":"https://maps.app.goo.gl/wGfcdde817MKFN327"},{"id":3,"name":"Pho Than Brothers","slug":"pho-than-brothers","cover":"pho-than-brothers-1.png","meals":"Lunch, Dinner","cuisine":"Vietnamese","type":"Restaurant","tags":"Pho","price":"$","notes":"Order at the table and pay at the register. Service is super speedy. There are plenty of meat and bowl size options. Prices are fair for what you get.","rating":"A","address":"527 Broadway E, Seattle, WA 98102","url":"https://maps.app.goo.gl/uJdLkKec4kgC5yVL8"},{"id":4,"name":"Rondo Japanese Kitchen","slug":"rondo-japanese-kitchen","cover":"rondo-japanese-kitchen-1.png","meals":"Lunch, Dinner","cuisine":"Japanese","type":"Restaurant","tags":"Ramen, Sashimi, Donburi, Sushi","price":"$$","notes":"Higher end foods with nice presentation. Can get very busy during peak hours.","rating":"B","address":"224 Broadway E, Seattle, WA 98102","url":"https://maps.app.goo.gl/6sBx9XhtFgDzDHceA"},{"id":5,"name":"Fogón Cocina Mexicana","slug":"fogon-cocina-mexicana","cover":"fogon-cocina-mexicana-1.png","meals":"Lunch, Dinner","cuisine":"Mexican","type":"Restaurant","tags":"Tacos, Nachos, Enchiladas, Burritos, Tortas","price":"$","notes":"Hand made tortillas. Happy hour is from 3-6pm daily. Outside seating by the sidewalk is available.","rating":"A","address":"600 E Pine St, Seattle, WA 98122","url":"https://maps.app.goo.gl/oGp7iiG3EtyWWoLv8"},{"id":6,"name":"Pelicana Chicken","slug":"pelicana-chicken","cover":"pelicana-chicken-1.png","meals":"Lunch, Dinner","cuisine":"Korean","type":"Restaurant","tags":"Fried Chicken, Fried Wings","price":"$$$","notes":"Bone and boneless options. Lots of other fried items on the menu. Delicious sauce options. Crazy expensive for the portions you get.","rating":"C","address":"725 E Pine St, Seattle, WA 98122","url":"https://maps.app.goo.gl/AhpTJWhiAYKdbWXz9"},{"id":7,"name":"Biang Biang Noodles","slug":"biang-biang-noodles","cover":"biang-biang-noodles-1.png","meals":"Lunch, Dinner","cuisine":"Chinese","type":"Restaurant","tags":"Noodles, Soups, Green Onion Pancake, Milk Tea","price":"$$","notes":"Hand pulled noodles. Noodle bowls are massive. Plenty of side dishes and drink options. Can get quite spicey if you ask for it.","rating":"A","address":"601 E Pike St Unit 100, Seattle, WA 98122","url":"https://maps.app.goo.gl/vVpjr882LWddjsZt7"},{"id":8,"name":"Ayutthaya","slug":"ayutthaya","cover":"ayutthaya-1.png","meals":"Lunch, Dinner","cuisine":"Thai","type":"Restaurant","tags":"Noodles, Curries, Rice","price":"$","notes":"Small space with wooden furniture. Usually only one person in the front of house. Typical thai options and flavors.","rating":"B","address":"727 E Pike St, Seattle, WA 98122","url":"https://maps.app.goo.gl/LP9HPYjd2c1TEMrQ9"},{"id":9,"name":"Kati Vegan Thai","slug":"kati-vegan-thai","cover":"kati-vegan-thai-1.png","meals":"Lunch, Dinner","cuisine":"Thai","type":"Restaurant","tags":"Cauliflower, Satay, Portobello, Pho, Soups, Rice, Stir Frys, Curries, Noodles","price":"$$","notes":"Entire menu is vegan. Lots of variety and has both modern and traditional flavors. Interior is quite beautiful.","rating":"A","address":"1190 Thomas St, Seattle, WA 98109","url":"https://maps.app.goo.gl/u17kuasEL2uuZxbS9"},{"id":10,"name":"Vinason Pho Kitchen","slug":"vinason-pho-kitchen","cover":"vinason-pho-kitchen-1.png","meals":"Lunch, Dinner","cuisine":"Vietnamese","type":"Restaurant","tags":"Pho, Banh Mi, Vermicelli, Salads, Spring Rolls","price":"$$$","notes":"Minimal bar seating since it\'s a corner store. Ordering is via tablet/screen. Portion size is small for how expensive it is.","rating":"C","address":"2134 Westlake Ave, Seattle, WA 98121","url":"https://maps.app.goo.gl/j9nFukxrsWAxRZKR7"},{"id":11,"name":"Made in House","slug":"made-in-house","cover":"made-in-house-1.png","meals":"Lunch, Dinner","cuisine":"Korean","type":"Restaurant","tags":"Bibimbap, Japchae","price":"$$","notes":"Best bibimbap I\'ve ever had. Simple healthy menu of korean fusion foods. Pricing matches portion. Cafe has specialty coffee drinks.","rating":"S","address":"3508 Fremont Pl N, Seattle, WA 98103","url":"https://maps.app.goo.gl/gCr9ehJsz5vjbs1dA"},{"id":12,"name":"Mendocino Farms","slug":"mendocino-farms","cover":"mendocino-farms-1.png","meals":"Lunch","cuisine":"American","type":"Restaurant","tags":"Sandwiches, Salads, Soups","price":"$$$","notes":"Expensive gourmet healthy entrees. Made with local and seasonal ingredients. Can get very crowded during lunch hours.","rating":"B","address":"2118 Westlake Ave, Seattle, WA 98121","url":"https://maps.app.goo.gl/gd7Wshj1XaLzEPRk6"},{"id":13,"name":"Pagliacci Pizza","slug":"pagliacci-pizza","cover":"pagliacci-pizza-1.png","meals":"Lunch, Dinner","cuisine":"American","type":"Restaurant","tags":"Pizzas","price":"$","notes":"Local and laid-back pizzeria. Known for large and thin slices. Many locations across seattle. Offers free slices throughout the year.","rating":"A","address":"415 E Pike St, Seattle, WA 98122","url":"https://maps.app.goo.gl/CKJQbj9RTk1CbKJE6"},{"id":14,"name":"Plum Bistro","slug":"plum-bistro","cover":"plum-bistro-1.png","meals":"Lunch, Dinner","cuisine":"American","type":"Restaurant","tags":"Burgers, Tacos, Gnocchi, Portobello, Ravioli, Pizzas","price":"$$$","notes":"Creative all vegan menu. Food is quite delicious. A bit expensive for what you get, but the ambiance makes up for it.","rating":"A","address":"1429 12th Ave, Seattle, WA 98122","url":"https://maps.app.goo.gl/cdEdgvdMz8cE57eU7"},{"id":15,"name":"Tamari Bar","slug":"tamari-bar","cover":"tamari-bar-1.png","meals":"Lunch, Dinner","cuisine":"Japanese","type":"Restaurant","tags":"Baos, Wagyu, Noodles, Ramen, Sushi, Sashimi","price":"$$","notes":"Specalizes in Japanese drinks, snacks, and street food. Happy hour from 5-6pm. Industrial indoor space, airy outdoor space.","rating":"A","address":"500 E Pine St, Seattle, WA 98122","url":"https://maps.app.goo.gl/c34FDnn2pMEREgXD7"},{"id":16,"name":"Mamnoon","slug":"mamnoon","cover":"mamnoon-1.png","meals":"Lunch, Dinner","cuisine":"Middle Eastern","type":"Restaurant","tags":"Hummus, Kebabs, Salmon","price":"$$$","notes":"Way too expensive for the portions given. Hummus was good. Entrees were tiny. Cocktails...average. Spent way too much money here and left hungry.","rating":"C","address":"500 E Pine St, Seattle, WA 98122","url":"https://maps.app.goo.gl/rVtZ664qH89t2mt87"},{"id":17,"name":"Bangrak Market","slug":"bangrak-market","cover":"bangrak-market-1.png","meals":"Lunch, Dinner","cuisine":"Thai","type":"Restaurant","tags":"Garden Rolls, Satay, Soups, Pad Thai, Currys, Rice","price":"$$","notes":"Extensive menu of classic Thai street food. Amazing portion sizes for the price. A favorite among locals. The decor is cute and colorful.","rating":"S","address":"2319 2nd Ave, Seattle, WA 98121","url":"https://maps.app.goo.gl/UNFCUF4PqWXE2tWr6"},{"id":18,"name":"Momiji","slug":"momiji","cover":"momiji-1.png","meals":"Lunch, Dinner","cuisine":"Japanese","type":"Restaurant","tags":"Soups, Salads, Noodles, Sushi, Sashimi, Omakase, Rolls, Sake","price":"$$$","notes":"Contemporary Japanese apps and mains. Has a robust sushi menu, plus sake. Expensive, but somewhat worth it. Sleek setting.","rating":"B","address":"731 Bell St, Seattle, WA 98121","url":"https://maps.app.goo.gl/MTmYD1xffNKZXhhg8"},{"id":19,"name":"Lucky\'s Pho","slug":"luckys-pho","cover":"luckys-pho-1.png","meals":"Lunch, Dinner","cuisine":"Thai","type":"Restaurant","tags":"Pho, Banh Mi","price":"$","notes":"My top pho place in Seattle. Self serve toppings bar. Very clean setup and service is quick.","rating":"S","address":"3414 Fremont Ave N, Seattle, WA 98103","url":"https://maps.app.goo.gl/nLovr3Kuf3TgD8Cp7"},{"id":20,"name":"Portage Bay Cafe","slug":"portage-bay-cafe","cover":"portage-bay-cafe-1.png","meals":"Breakfast, Brunch, Lunch","cuisine":"American","type":"Restaurant","tags":"Benedicts, Sandwhiches, Bowls, Pancakes, French Toast, Omelettes, Oats","price":"$$","notes":"A well-known local brunch chain. Has a fruit bar. Can get very busy during brunch hours on weekends. Has blankets and outdoor heating for colder months.","rating":"A","address":"391 Terry Ave N, Seattle, WA 98109","url":"https://maps.app.goo.gl/ugD4yeFZFDYd4uGz8"},{"id":21,"name":"Bai Tong Thai Street Cafe","slug":"bai-tong-thai-street-cafe","cover":"bai-tong-thai-street-cafe-1.png","meals":"Lunch, Dinner","cuisine":"Thai","type":"Restaurant","tags":"","price":"$$","notes":"On a corner of pike. Uses robots to deliver food to tables. Reasonable prices and nice presentation. Never needed a reservation.","rating":"A","address":"1121 E Pike St, Seattle, WA 98122","url":"https://maps.app.goo.gl/vbQNQjnBLKh8U5ag6"},{"id":22,"name":"Li\'l Woody\'s","slug":"lil-woodys","cover":"lil-woodys-1.png","meals":"Lunch, Dinner","cuisine":"American","type":"Restaurant","tags":"Fries, Burgers","price":"$","notes":"Best fries in the area. And they give you heaploads of them! Burgers and shakes are good too.","rating":"A","address":"1211 Pine St, Seattle, WA 98101","url":"https://maps.app.goo.gl/CkgYsKaL59BPZooa7"},{"id":23,"name":"Kizuki Ramen & Izakaya","slug":"kizuki-ramen-and-izakaya","cover":"kizuki-ramen-and-izakaya-1.png","meals":"Lunch, Dinner","cuisine":"Japanese","type":"Restaurant","tags":"Ramen","price":"$$","notes":"Decent ramen at decent prices. Good appetizers. Friendly and attentive servers. Sign up for their text club and get discounts from time to time.","rating":"A","address":"320 E Pine St, Seattle, WA 98122","url":"https://maps.app.goo.gl/nbnLQT7kXekp958U8"},{"id":24,"name":"The Pink Door","slug":"the-pink-door","cover":"the-pink-door-1.png","meals":"Lunch, Dinner","cuisine":"Italian","type":"Restaurant","tags":"Pasta","price":"$$$","notes":"The decor here is pretty unique and stunning. Def take some pics here! They even place real candle sticks at each table. Need reservations during peak hours.","rating":"A","address":"1919 Post Alley, Seattle, WA 98101","url":"https://maps.app.goo.gl/FkBpNx3zgQ1QNu6L6"},{"id":25,"name":"Oddfellows Café","slug":"oddfellows-cafe","cover":"oddfellows-cafe-1.png","meals":"Breakfast, Brunch, Lunch","cuisine":"American","type":"Restaurant","tags":"French Toast, Benedicts, Shakshouka","price":"$$","notes":"Favorite place to get brunch in Seattle. Located in the heart of Cap Hill. Great vibes and has outdoor seating. Classic brunch items but on another level. Loved the Shakshouka.","rating":"S","address":"1525 10th Ave, Seattle, WA 98122","url":"https://maps.app.goo.gl/C7391FVkFDNEQFPF6"},{"id":26,"name":"Café Hagen","slug":"cafe-hagen","cover":"cafe-hagen-1.png","meals":"Breakfast, Brunch, Lunch","cuisine":"Scandinavian","type":"Restaurant, Cafe","tags":"","price":"$$$","notes":"Immaculate cafe vibes. Amazing scandinavian-inspired food and drink. A bit pricey, but it\'s worth it. Pastries are unique and absolutely delicious. Seasonal drinks are always tasty.","rating":"S","address":"1252 Thomas St, Seattle, WA 98109","url":"https://maps.app.goo.gl/ksCoZRJu2g5xBhKFA"},{"id":27,"name":"Wunderground Cafe","slug":"wunderground-cafe","cover":"wunderground-cafe-1.png","meals":"Breakfast, Brunch, Lunch","cuisine":"American","type":"Cafe","tags":"Mushrooms, Avocado Toast, Coffee","price":"$","notes":"Known for mushroom-infused coffees. Pretty great foods as well. Wifi is fast and there is plenty of seating indoors and outdoors. Service has always been great. Interior is themed and clean.","rating":"A","address":"1111 E Pike St #111, Seattle, WA 98122","url":"https://maps.app.goo.gl/1VGNRKgYeMpuPGci8"},{"id":28,"name":"HoneyHole Sandwiches","slug":"honeyhole-sandwiches","cover":"honeyhole-sandwiches-1.png","meals":"Lunch, Dinner","cuisine":"American","type":"Restaurant","tags":"Sandwiches","price":"$$","notes":"Controversial, local sandwhich shop. Smaller interior, but has nice booth and bar seating. Sandwiches are fine. French fries are good. Is often open late.","rating":"C","address":"703 E Pike St, Seattle, WA 98122","url":"https://maps.app.goo.gl/27JYwANGCE4yKAr59"},{"id":29,"name":"Lost Lake","slug":"lost-lake","cover":"lost-lake-1.png","meals":"Breakfast, Brunch, Lunch, Dinner","cuisine":"American","type":"Restaurant","tags":"","price":"$$","notes":"Small diner feel with 2 separate seating sections: 1 for the bar, 1 family friendly. Open early and very late. Food is decent, but not great.","rating":"B","address":"1505 10th Ave, Seattle, WA 98122","url":"https://maps.app.goo.gl/27JYwANGCE4yKAr59"},{"id":30,"name":"Tavolàta","slug":"tavolata","cover":"tavolata-1.png","meals":"Lunch, Dinner","cuisine":"Italian","type":"Restaurant","tags":"Pasta","price":"$$$$","notes":"Appetizers and housemade pastas were good, however definitely not worth the price. Portions are quite small. Ambience was okay. Has outdoor seating.","rating":"C","address":"501 E Pike St, Seattle, WA 98122","url":"https://maps.app.goo.gl/EF83NUDqPVWgghsdA"},{"id":31,"name":"Sizzle&Crunch","slug":"sizzle-and-crunch","cover":"sizzle-and-crunch-1.png","meals":"Lunch, Dinner","cuisine":"Vietnamese","type":"Restaurant","tags":"","price":"$","notes":"Like Chipotle, but with Vietnamese food. Fresh vegetables, grilled meats, and with right amount of spices. Generous topping of cilantro and dressing. Bowls, Bahn Mi\'s, and Noodles.","rating":"A","address":"500 9th Ave N ste 150, Seattle, WA 98109","url":"https://maps.app.goo.gl/sWr1b8ivkcav4b8Q7"},{"id":32,"name":"Communion","slug":"communion","cover":"communion-1.png","meals":"Breakfast, Brunch, Lunch, Dinner","cuisine":"American","type":"Restaurant","tags":"","price":"$$","notes":"Tastefully decorated interior serving comforting soul food. Either have a reservation or come early to get a spot. Lots of culture and culinary heritage. Perfect for a larger group of people.","rating":"A","address":"2350 E Union St, Seattle, WA 98122","url":"https://maps.app.goo.gl/oZf1HzUL1eCuEEPU7"}]');

